import { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import styled from 'styled-components'
import { InputField } from '../components/InputField'
import { fetchPhoneWordsStartAsync } from '../redux/actions'

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`

const Title = styled.h1`
  font-size: 3rem;
  color: #41444b;
`

export const Home = () => {
  const [number, setNumber] = useState('')
  const dispatch = useDispatch()
  const data = useSelector(state => state.wordsData)

  // console.log(data)

  useEffect(() => {
    dispatch(fetchPhoneWordsStartAsync())
  }, [dispatch])

  return (
    <Container>
      <Title>Phonewords Converter</Title>
      <InputField placeholder='Only digits from 2 to 9' />
    </Container>
  )
}
